import React, { Component } from 'react'
import Navbarmenu from "./component/Navbarmenu"
import Headerveiw from "./component/headerveiw"

export default class App extends Component {
  render() {
    return (
      <section style={Home}>
        <Navbarmenu />
        <Headerveiw />
      </section>
    )
  }
}
const height = window.innerWidth < 760 ? 150 : window.innerHeight;
const Home ={
  background:"#000",
  height:height
}
